import React, { Component, Fragment} from 'react';

import Paper from '@material-ui/core/Paper';
import Button from '@material-ui/core/Button';

class addressBar extends Component {
  render() {
    var imageStyle = {
      width: "80%",
      display: 'block',
      marginLeft:"auto",
      marginRight: "auto",
      marginTop:"10%",
      marginBottom:"10%"
    }

    return (
      <Paper elevation={3} style={{position: 'fixed', bottom:"5%", left:"10%", width:"80%", background:"WhiteSmoke", alignItems:'center', 
      justifyContent: 'center', paddingLeft:"5%", paddingRight:"5%", paddingBottom:"5%"
      }}>
          <img src="/no_stores.svg" alt="Hombre caminando solo en callejón oscuro" style={imageStyle}></img>
          <h3>Opps! lo sentimos<br></br><small>No hay negocios registrados cerca de tí</small></h3>
          <p>Puedes cambiar de úbicación ingresando una nueva dirección en la parte de arriba o si conoces negocios cerca de tu ubicación compartenos los datos y realizaremos el pedido por ti.</p>
          <Button variant="contained" color="primary">Hacer pedido en tienda no registrada</Button>
      </Paper>
    );
  }
}

export default addressBar;
